import axios from "axios";

const USERS_REST_API_URL = 'http://localhost:3000/staff/menu/chicken';

class UserService{

    getUsers(){
        return axios.get(USERS_REST_API_URL)
    }

    postUsers(){
        return axios.post(USERS_REST_API_URL, "test");
    }

}

export default new UserService()
